import React from 'react';
import { Figure, Row, Col } from 'react-bootstrap';

const Projects = () => {
	return (
        <div className="App-header">
            <br/>
            <br/>
            <header>
                <p>
                Edit your life and save to reload.
                </p>
                <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                    >
                    Learn Projects
                </a>
            </header>
            <br/>
            <br/>

        </div>
	);
};

export default Projects;
